import "./App.css";
import Input from "./components/Input.js";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ItemsList from "./components/ItemsList.js"; // if you created it

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Input />} />
        <Route path="/items" element={<ItemsList />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
